●内容量／42g<br>●成分／グリセリン、水、ソルビトール、キシリトール、カルボマー、ヒドロキシエチルセルロース、水酸化Na<br>●うるおい、口臭予防<br><br>・どなたでも使用できる中性の湿潤剤。<br><style type="text/css">
