<img src="http://event.rakuten.co.jp/campaign/point-up/marathon/20170107/other/borderless/img/bnr/700x100ja-shop.png"><br><br>

【特徴】<br>
今、世界で話題沸騰中の疎水性防水スプレーがついに入荷致しました。<br>
光学的に透明な保護バリア剤で靴全体を保護します。<br>
染みや汚れ付着物、ほとんどの液体を弾じきます。<br>
この製品は、靴業界に革命をもたらす程の逸品。<br>
20cm程離した所から靴本体にスプレーし、10分間乾かすだけですぐにご使用になれます。<br>
レザー、スウェード、ヌバック、キャンバス地などにご使用になれます。<br>
新感覚の疎水性防水スプレーで、非常に撥水生が高く一本は必需品になる事間違い無いオススメのスプレーです。<br>
<br>
【容量】<br>
200ｍｌ<br>
<br>
【使用方法】<br>
１.20ｃｍ離しスプレー<br>
２.10分間乾燥<br>
<br>
【備考】<br>
※こちらは店頭でも販売している商品で、在庫確保された商品ではない為、在庫切れでお届けが遅れたり販売ができない場合がございます。予めご了承ください。<!--ここまでバナーエリア--> 



